import { useHistory } from 'react-router-dom';
import UpdateMeetupForm from '../components/meetups/UpdateMeetupForm';

function UpdateMeetupPage() { 
    const history = (useHistory);

    function updateMeetupHandler(meetupData) {

        fetch('https://fir-react-scheduler-default-rtdb.firebaseio.com/meetups.json', 
        {
            method: 'POST',
            body: JSON.stringify(meetupData),
            headers: {
                'Contype-Type': 'application/json'
            }
        }).then(() => {
            history.replace('/');
        });

       }

    return (
        <section>
        <h1>Update Meetup</h1>
        <UpdateMeetupForm onAddMeetup={updateMeetupHandler}/>
        </section>

        );


}

export default UpdateMeetupPage;
